import React from 'react';
import './Section.css';

function Fish() {
  return (
    <div className="section fishes">
      <h2>Fishes</h2>
      <p>Where fins flutter, hearts find peace!</p>
      <p>
        From aquariums to fish food and accessories, we provide everything you need for your aquatic pets. Create a beautiful and healthy environment for your fish with our quality products.
      </p>
      <button>Shop Now</button>
    </div>
  );
}

export default Fish;
